import * as action from "./actionsType";

export function upvote(vote, action) {
  return {
    type: action.UPVOTE,
    vote
  };
}

export function downvote(vote, action) {
  return {
    type: action.DOWNVOTE,
    vote
  };
}

export function memsFetched(mems, action) {
  return { type: action.FETCH_MEMS_SUCCESS, mems };
}
